        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](14, "The term UI/UX design is pretty common in the digital world and many people have heard it at least once, no doubt. But there are still some misconceptions and confusion surrounding its actual meaning. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](15, "p", 12);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](16, " already talked about the role of a UI/UX designer at a digital agency, in this blog we want to introduce this discipline a little more thoroughly and help you get an even better understanding of that profession.");
