        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](39, "p", 11);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](40, "UI design relates to the appearance and feel of a digital product. It focuses on visual factors like buttons, fonts, colour schemes, images, interactive elements, etc. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](41, "p", 11);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](42, "So, what is user experience design, then? Well, it refers to the experience a user has interacting with your product. Its main focus is enabling seamless goal achievement for users. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](43, "p", 11);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](44, "You can look at the difference through the example of a car. The UX would be the mechanics of your car, like engine power, transmission type or fuel consumption. The UI would be the aesthetics, such as the livery, paint, rims, dashboard or seats. Or, you can imagine furnishing a home; think of the UX designer as the construction manager, and the UI designer as the interior designer. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
