        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](61, "p", 11);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](62, "As for UI, the point is to make the interface aesthetically pleasant for users, but also to add to the efficiency and ease that the UX designer has planned out. Additionally, it\u2019s important that the product reflect the brand\u2019s image and vision properly. So, UI designers are responsible for creating an interface that is: ");
