        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](96, "The first phase is, of course, the phase of research and analysis. UI/UX designers need to have an excellent understanding of the challenges, needs, goals and expectations of users. They also need to fully understand the business they\u2019re designing for and be familiar with their industry and current market. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](97, "p", 11);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](98, "During this stage, business requirements and product documentation are collected, as well as insights about the brand\u2019s target audience. All this information is then analysed for the purpose of mapping (experience, empathy and journey maps), forming user personas, scenarios and stories, and ultimately having a strategy to create a design that\u2019ll fulfil the brand\u2019s vision and user preferences.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](99, "div", 30);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](100, "h6", 31);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](101, "2. Design");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](102, "p", 11);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](103, "During the design phase, all the maps and ideas are considered and several sketches are created. The main deliverable in this phase is the wireframe. This can happen once all the requirements have been assembled and the structure, navigation and future interface elements are defined. Style guides and moodboards are also created in this stage. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](104, "p", 11);
