        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](42, "For new UX designers who are only just testing the internship waters or are in junior positions, the design process can be overwhelming. A lot of work goes into designing, so knowing your place in the process is significant in several ways.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
