        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](101, "When designing, you need to take into account the user\u2019s context. Location is a commonly understood contextual factor\u2014are you designing for someone on the go or for someone sitting at a desk? But there are other things to consider, including the time available with the user, their emotional state, the device they are using, the people who influence them, and more.");
