        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](115, "UX design is entirely focused on solving the users\u2019 problems, which makes usability of the design one of the most crucial user experience design principles. No matter how aesthetically pleasing your work may be, it won\u2019t strike a chord with the user unless it is safe and easy to use.");
