        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](117, "A case in point here is website design. Any site that is cluttered is bound to lose visitors. As a designer, your job is to make sure that each icon, button, and snippet of information that is present within the design has a purpose. Concentrate on clarity by bringing only useful features to the user\u2019s attention.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
