        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](119, "Usability is the reason why prominent buttons and a minimalist design with few elements increase the click-through rate (CTR). Precision Marketing Group doubled the CTR on their call-to-action button by changing the shape and size of the button.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
