        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](122, "p", 11);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](123, "If many people experience similar problems, you will have to make changes to the design to sort out the usability issue. Keep in mind that design is an iterative process and it demands improvements in all stages.");
