        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](137, "The less-is-more design principle was originally proposed by the architect Ludwig Mies van der Rohe. For UX, the underlying aim of this is simple: reducing the operational and cognitive costs of the users. In placing value on this, the design\u2019s usability and consistency improve.");
