        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](33, "Typography is the art of arranging letters and text in a way that makes the copy legible, clear, and visually appealing to the reader.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](34, "p", 16);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](35, "It involves font style, appearance, and structure, which aims to elicit certain emotions and convey specific messages. In short, typography is what brings the text to life.");
