        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](19, "Whether it\u2019s on our phones, in books or on websites, we\u2019re constantly digesting written words. From instruction booklets to shop fronts, type is all around us.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](20, "p", 16);
