        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](23, "Behind the scenes, a designer has taken the time to consider the relationship between the look of the text and what the text says. In reality, different moods, atmospheres, and even trends can be expressed simply through the type choice. But what actually is typography\u2014and why is it so vital?");
