        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](75, " Typography has a profound effect on the way that users digest and perceive the information conveyed by the text. Eye-catching type is much more persuasive than weak fonts that don\u2019t reinforce the message of the text.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
