        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](70, "User Experience (UX) and User Interface (UI) designs are the most important terms in web and app development and are often underlooked during software development, but they play a big silent role in attracting customers by providing a visually appealing, smooth, and functional experience to them. For example, Adobe XD is a very popular free-to-use tool that allows us to create prototypes and wireframes that help us in designing web and mobile applications. In this session, we learn the basics of UI/UX philosophy, and the difference between them, wireframing, prototyping, and user testing. We will also be discussing what the UX process is, what is a prototype, an example of user testing, tools that will be used for this purpose, UI concepts, and a lot more. All of this will help you form a framework that will help you build the career of your choice and bring you to appreciate this under-appreciated practice. ");
